from typing import List


# https://leetcode.com/problems/minimum-number-of-vertices-to-reach-all-nodes/
class Solution:

    # Runtime: 2248 ms, faster than 20.00%
    def findSmallestSetOfVertices(self, n: int, edges: List[List[int]]) -> List[int]:
        return list(set(range(n)) - set(n2 for n1, n2 in edges))

    # Runtime: 1256 ms, faster than 100.00%
    def all_from_not_in_to(self, n: int, edges: List[List[int]]) -> List[int]:
        node_to = set(n2 for n1, n2 in edges)
        node_from = set()
        for n1, n2 in edges:
            if n1 not in node_to:
                node_from.add(n1)
        return list(node_from)

    def one_linear(self, n: int, edges: List[List[int]]) -> List[int]:
        return list(filter(lambda n1: n1 not in (n2 for n1, n2 in edges), set([n1 for n1, n2 in edges])))


